import logo from '../../images/logo.svg';

export default function Header() {
  return (
    <header className='header'>
      <div className='header__container'>
      <img className='header__logo' src={logo} alt='лого' />
      <div>
      <span className='header__nav'>123</span>
      <span className='header__nav'>123</span>
      </div>
      </div>
    </header>
  );
}
